import styled from 'styled-components';

export const LoginWrapper = styled.div`
    z-index: 0;
    position: absolute;
    left: 0;
    right: 0;
    top: 65px;
    bottom: 0;
    background: #eee;
`

export const LoginBox = styled.div`
    width: 400px;
    height: 200px;
    margin: 50px auto;
    background: #fff;
    box-shadow: 0 0 8px rgba(0,0,0,.1);
`
